import classes from "./Navbaritem.module.css";

const NavBarItem = (props) => {
  return (
    <div className={classes.navbaritem}>
      <div>
        <image>{props.icon}</image>
      </div>
      <div>
        <p>&nbsp;{props.type}</p>
      </div>
    </div>
  );
};
export default NavBarItem;
